// SearchBar.jsx

import React, { useState } from 'react';
import "./SearchBar.css";
import search_icon from '../../Assets/search-icon.png';

const SearchBar = ({ setCity, setCountry }) => {
    const [cityInput, setCityInput] = useState("");
    const [countryInput, setCountryInput] = useState("");

    const handleSubmit = (e) => {
        e.preventDefault();
        setCity(cityInput);
        setCountry(countryInput);
    };

    return (
        <div className='search-bar'>
            <form onSubmit={handleSubmit}>
                <img className="search-icon" src={search_icon} alt="search icon" />
                <input onChange={(e) => setCityInput(e.target.value)} type="text" name="city" placeholder="City"/>
                <input onChange={(e) => setCountryInput(e.target.value)} type="text" name="country" placeholder="Country"/>
                <button type="submit">Search</button>
            </form>
        </div>
    );
};

export default SearchBar;
